const BACKEND_URLS = 'http://localhost:8080';

const GET_BLOG_DATA = {
  url: 'blog-posts/',
  method: 'get',
};

const UPDATE_LIKE = (blogId) => ({
  url: `blog-posts/like/${blogId}`,
  method: 'put',
});

const UPDATE_CLAP = (blogId) => ({
  url: `blog-posts/clap/${blogId}`,
  method: 'put',
});

module.exports = {
  BACKEND_URLS,
  GET_BLOG_DATA,
  UPDATE_LIKE,
  UPDATE_CLAP,
};
